import React from 'react';
import './Achievements.css';

const Achievements = () => {
    return (
        <section className="achievements">
            <h2>Achievements</h2>
            <p>
                Kohli has numerous awards and accolades to his name, including:
            </p>
            <ul>
                <li>Arjuna Award (2013)</li>
                <li>Padma Shri (2017)</li>
                <li>Rajiv Gandhi Khel Ratna (2018)</li>
                <li>ICC Cricketer of the Year (2017, 2018)</li>
                <li>Wisden Leading Cricketer in the World (2016, 2017, 2018, 2019)</li>
            </ul>
        </section>
    );
};

export default Achievements;
